import React from "react";
import { useParams } from "react-router-dom";
import AuxiliaryConverter from "../components/AuxiliaryConverter";
import Converter from "../components/Converter";
import FunFacts from "../components/FunFacts";

export default function CategoryPage() {
  const { categoryName } = useParams();

  if (!categoryName) return <div>Category not found</div>;

  return (
    <div className="p-6 bg-white rounded shadow space-y-6">
      <h1 className="text-2xl font-bold text-center mb-4">{categoryName}</h1>
      <AuxiliaryConverter categoryName={categoryName} />
      <Converter categoryName={categoryName} />
      <FunFacts categoryName={categoryName} />
    </div>
  );
}
